w:r.w:t:
The scope of the Claims and Reimbursement informative
        document defines the HL7 messaging and technical standards
        for:

Electronic transmission of healthcare invoices, with
        supporting documents and reports, to authorized individuals
        and/or organizations;

A query mechanism to allow authorized users to
        electronically inquire about information they have
        previously provided to a Payer;

for each Product/Service Line Item it processes,
        specified as the Provider Tracking Number or Payer Tracking
        Number.
